import { useEffect, useState } from "react";
import api from "../services/api.js";
import styled from "styled-components";
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Typography from '@mui/material/Typography';
import { CardActionArea } from '@mui/material';
import "../../styles/App.css";
import EngineInfo from "../CardMotor/CardMotor.jsx";


const Grid = styled.div`
  width: 300px;
  height: 430px;
  margin: 5px 20px;
`

function Motor() {
  const [models, setModels] = useState([]);

  useEffect(() => {
    api.get("assets").then((response) => {
      console.log("motor", response.data);
      setModels(response.data);
    });
  }, []);

  return (
    <div className="container grid grid-template-columns">
      
      {models.map((models, key) => {
        return (
          <Grid>
          <Card sx={{ maxWidth: 500,  }}>
          <CardActionArea onClick={EngineInfo } >
            <CardMedia
              component="img"
              height="300"
              image={models.image}
              alt="engine image"
            />
            <CardContent >
              <Typography gutterBottom variant="h5" component="div">
                {models.name}
              </Typography>
              <Typography variant="body2" color="text.secondary">
              üíñ {models.healthscore}%
              </Typography>
              <Typography variant="body2" color="text.secondary">
              ‚ö°{models.status}
              </Typography>
              <Typography variant="body2" color="text.secondary">
              üå°Ô∏è{models.specifications.maxTemp}¬∞C
              </Typography>
            </CardContent>
          </CardActionArea>
        </Card>
        </Grid>                
        );
      })}
      </div>
  );
}

export default Motor;
